import React from "react";
import { PDFDownloadLink, Document, Page } from "react-pdf";

const styles = {
  container: {
    marginLeft: "30px",
    marginTop: "30px",
  },
  p: {
    display: "block",
    marginBottom: "10px",
    color: "black",
    fontSize: "20px",
  },
};

function Resume() {
  return (
    <div className="right">
      <div style={styles.container}>
        <PDFDownloadLink document={<MyDocument />} fileName="my_document.pdf">
          {({ blob, url, loading, error }) =>
            loading ? "Loading document..." : "Download PDF"
          }
        </PDFDownloadLink>
      </div>
    </div>
  );
}

export default Resume;
